INSERT INTO `blog` VALUES (1,'Move','wicky','2014-07-10','<p>&nbsp; 之前曾说过，如果再次搬家绝对再也不用WP了，由于之前ec2到期了，就临时迁到了lofter，现在自己用flask写了一个博客，虽然简陋的要死。。。但是也是下功夫了，先临时这么用着，后续我还继续完善，现在简直粗糙的不忍直视。。</p>\r\n<p>&nbsp; 如果你是我之前友链的朋友，麻烦你mail to i@sihaizi.com 告诉我下你的链接，之前因为vps到期匆忙，买来得及迁移，全丢了，谢谢~</p>\r\n<p>&nbsp; PS:现在的vps还是ec2，挑了半天最后还是选了ec2，是因为ec2可以免费使用，东京或者新加坡机房，速度颇快，只要你有visa卡，注册个帐号，选免费试用就可以了，每个帐号可以试用一年，当然开始用之后，amazon会验证你的银行卡真伪扣掉1$,但这也足够便宜了，不是么。</p>','static/2014-07-10'),(3,'听过很多道理，仍然过不好这一生','wicky','2014-07-22','<p>这部电影之所以吸引我，和老罗的Smartisan T1 一样，都是因为让人触不可及的逼格和青葱二逼的那段时光有关。《三重门》、《像少年啦飞驰》以及《1988 我想和世界谈谈》一直伴着我那段时光，所以总对韩寒有些期待。还有这次朴树的主题曲，唱到我的心坎。想想之前朴树的歌，最常听的就那几首，而唱到心里的也就是那首《傲慢的上校》且是因为节奏和调调，而这次的是歌词和编曲都完美至极。听完让我自身感觉又多了一点沧桑和文艺。</p>\r\n<p>后天上映我会去看，带着我上辈子的小情人一起。不喜欢朋友圈里的剧透和拍张电影票秀恩爱和秀文艺，所以本屌一定要第一天就去看。。。不给剧透的人机会！！！</p>\r\n<p>&ldquo;听过很多道理，仍然过不好这一生&rdquo;</p>','static/2014-07-22'),(4,'浪费是最大的犯罪','wicky','2014-07-23','<p>&nbsp; 这几年买了好几个域名，一直想做点啥，至今懒的也没有做些啥，一直荒废着，xxx便宜注册的时候还注册了一个，导致今年自动续费了，扣了好多$，没疼死我。</p>\r\n<p>&nbsp; 现在一并将这几个域名全部都绑到博客上了，最起码不算荒废着。谁有看好的也可以邮件我咨询域名转让哟。</p>\r\n<p>&nbsp; 以后通过 ifcry.com &nbsp; qingchun.xxx &nbsp; weiyaogun.com &nbsp;sihaizi.com都可以访问本博啦。 &nbsp;</p>','static/2014-07-23'),(10,'乱吠','wicky','2014-08-14','<p>1、哥本哈根13天，效果显著。 13天之后，立刻反弹至原形，其速度不逊于F22</p>\r\n<p>2、重新开始运动+饮食控制这个古老而神秘的减肥配方，丧心病狂。不知道到婚期那天能不能有显著的效果。</p>\r\n<p>3、最近又开始看《breaking bad》，最初是<a href=\"http://mark42.net\">方舟</a>推荐看的第一集，至此又想起来，从头开始看，已经看到第二季。过瘾，实在是佩服美剧编剧们的思维，总是有不可思议又顺理成章的理由让剧情往下进行。</p>\r\n<p>4、周二晚上吵架，一不小心差点酿成大祸。以后要告诫自己，不能再冲动了。</p>\r\n<p>&nbsp;</p>','static/2014-08-14'),(11,'脱单','wicky','2014-09-10','<p>&nbsp; 总的来说，结婚还是蛮开心的，就是太累人，完全不知道怎么应付那么多事，不过还是过来了。</p>\r\n<p>&nbsp; 婚礼上给老爹老妈鞠第一个躬的时候，心里莫名的被扎了一下，眼里就满了泪水，可能也跟那破煽情的背景音乐还有我的星座有关吧。</p>\r\n<p>&nbsp; 大学的兄弟们算是在我这结婚的时候来的最齐的一次，虽然还是有个别兄弟没来，有的确实可能是忙，也有的我明白，毕业之后便走在了不一条路上，越走距离的越远，到了现在这样互相无来往。本想凑齐这么一大帮人，可以痛饮到天亮的，可惜大家都已经成熟的不再那么放肆，我也有太多琐事赶回去处理，便没有出现想象中的那个画面。还好，半夜我抽空去他们住的旅店扯了会淡。感谢这些兄弟们，无以言表。</p>\r\n<p>&nbsp; 常年在异地，身为儿子，却没有尽到儿子的义务。想起来确实酸楚。而且在和爹妈聊天的时候，无意中听出来他们处理人情世故以及做人子女与做人父母中的无可奈何，实在是说不上来的难过。</p>\r\n<p>&nbsp; 今年过年会添加一个新成员，我期待着，期待她健健康康出世，快快乐乐成长。我能做的便只有抓紧时间给她更好的世界。</p>\r\n<p>&nbsp; 结婚过程中，根本没有时间让你去思考你真的结婚了，直到结完了才有时间意识到原来我真的已经结婚了。以后的岁月中要叫另一个女人为老婆，叫另外两位老人为爸妈。</p>','static/2014-09-10'),(12,'丧失了一些能力','wicky','2014-11-19','<p>越来越不喜欢和人交流，</p>\r\n<p>也越来越不喜欢笑脸迎人。</p>','static/2014-11-19'),(13,'随手记','wicky','2014-11-27','<p>1、poderline-shell</p>\r\n<p>2、tmux</p>\r\n<p>3、have you ever seen the rain</p>\r\n<p>4、everybody konws i love you</p>','static/2014-11-27'),(14,'迟来的回眸','wicky','2015-01-27','<p>&nbsp; 15年第一个月马上要过去了。</p>\r\n<p>&nbsp; 14年可以说五味杂陈，结了婚，有了娃。工作上各种不尽人意，但总算也是要解脱了。每一年的年底都会总结一番，盼望着新的一年里事事顺心，却每一年都没有如愿。生活可能就是这样，不顺心的事情总让人窘着额头，当不顺心的事情扛过去，才会有会心一笑、如释重负的幸福感。每次，都是这样安慰自己。遇上难事，总能想起初中物理老师的那句半开玩笑半讽刺的话「今年的主题依然是活着，孩子们，你们平时再怎么作，至少还活着就好」</p>\r\n<p>&nbsp; 当爹了，心态确实发生了一些微妙的变化，我开始处处考虑怎么给她安全感，想怎么提前给她准备好温馨的生活。出门在外也不再像以前那样不惜命。</p>\r\n<p>&nbsp; 还有尽孝，结婚生娃操碎了老两口的心，我这远在异乡，也没法经常回去。想想当初，确实有一丝后悔，毕业之后没有回到他们身边。不过也好，不在他们身边，矛盾就少了，想念便多了起来。</p>\r\n<p>&nbsp; 15年了，还是要给自己一些期许和憧憬。</p>\r\n<p>&nbsp; &nbsp; 1、希望这一年小麻花健健康康的成长。</p>\r\n<p>&nbsp; &nbsp; 2、我的创业也能顺顺利利。</p>\r\n<p>&nbsp; &nbsp; 3、脾气少点，小点。爱惜家人点，忍辱负重点。</p>\r\n<p>&nbsp; &nbsp; 4、把烦恼看淡些，笑一笑就过去了。</p>\r\n<p>&nbsp; &nbsp; 5、带媳妇抽个时间旅游下，总是看到别人四处游走，而我一直念叨却也没有动身。</p>\r\n<p>&nbsp; &nbsp; 6、烟戒掉</p>\r\n<p>&nbsp; &nbsp; 7、瘦身成功</p>\r\n<p>&nbsp; &nbsp; 8、买车</p>\r\n<p>&nbsp; &nbsp; 希望今年就这么过吧，期许不算高，尽量去完成。</p>','static/2015-01-27'),(15,'Django框架tree型备忘','wicky','2015-03-05','<p>&nbsp; 跟着Django Book 2.0中文版学习至今（英语是硬伤），被各种from...import...搞的晕乎乎，无奈找到一篇比较清晰的框架图，算是清楚了许多，遂转载并备忘下，原地址为<a href=\"http://site.douban.com/192043/widget/notes/11418540/note/247044376/\">http://site.douban.com/192043/widget/notes/11418540/note/247044376/</a></p>\r\n<p>&nbsp;&nbsp;&gt;&gt;&gt; django PROJECT直观上是一个动态网站，其实可以理解为一个app的容器。<br /><br />┌ Project<br />│<br />├──┬ mysite<br />│　 ├── manage.py　　　　＃管理引擎，用于启动服务器、检查程序、同步数据库等<br />│　 └─┬ mysite<br />│　 　 ├── __init__.py<br />│ 　　├── settings.py　　＃用于管理网站的所有配置，包括数据库，资源及app安装等<br />│ 　　├── urls.py　　　　＃url/服务路由，管理某个url调用app下面的服务<br />│ 　　└── wsgi.py # Python Web Server Gateway Interface 底层工具集配置<br />│<br />├──┬ app1<br />│ 　 ├── __init__.py<br />│ 　├── models.py　　＃app1 的数据模型，映射数据库结构<br />│ 　 ├── views.py　　　＃定义app services，由URL调用的app1 服务<br />│ 　 └── tests.py<br />│<br />├──┬ app2<br />│ 　 ├── __init__.py<br />│ 　├── models.py　　＃app2 的数据模型，映射数据库结构<br />│　 ├── views.py　　　＃定义app services，由URL调用的app2 服务<br />│　 ├── tests.py<br />│　 │　 #app2使用的包package1和package2<br />│　 ├─┬ package1<br />│　 │　├── __init__.py<br />│　 │　└── module1.py<br />│　 │<br />│　 └─┬ package2<br />│ 　 ├── __init__.py<br />│ 　 ├── module2.py<br />│　 └── module3.py<br />│<br />│　　　 　＃下面为可配置目录<br />├─── templates　　　　＃html 模版地址，在settings.py的TEMPLATE_DIRS配置<br />├─── database　　　　 ＃数据库地址，在settings.py的DATABASES下的&lsquo;names&rsquo;配置<br />└─── media　　　　　 ＃资源地址，在settings.py的MEDIA_ROOT配置<br /><br />&gt;&gt;&gt; 整个project通过DevServer的运作流程：<br /><br />1. 进入Projectmysite 然后在命令行运行 python manage.py runserver<br />-&gt; 加载 mysitesettings.py以及的mysiteurls.py设置（由于是用DevServer所以和wsgi.py没什么关系）<br />2. 发起url请求<br />-&gt; 经mysiteurls.py 路由访问到正确的app.views.service，如app1.views.svc1()<br />-&gt; 由app1.views.svc1() 调用models.py里面的class的某个实例，如app1.models.class1<br />-&gt; 访问由app1.models.class1 的实例封装的数据。<br />-&gt; 获得数据后，由app1.views.svc1() 生产content，如c<br />-&gt; 通过Template机制用一个html template t渲染content，如 t.render(c)<br />-&gt; url请求最终获得t.render(c) 后的页面。<br /><br />注意：<br /><br />&gt;&gt;&gt; mysite目录下面是没有views.py这个文件的，而是分布在各个app目录下，这是因为project主体mysite不是业务逻辑的承载者，而是业务逻辑的组织者。所有业务逻辑相关的服务都应该以app的形式在各自的views下进行封装。另一方面，mysite和apps在目录结构上是同级的，以强调app的可插拔性，即app是绝对独立的，app内任何内容都不应该依赖于project的其他结构存在。</p>',NULL),(16,'傻X零基础系列－－linux ssh小技巧','wicky','2015-03-17','<p>&nbsp; 以前的习惯是碰上问题就查下，找半天终于找到靠谱的文章，解决了问题，结果懒惰的没有记下解决问题的步骤，恰好也忘了把文章的链接加收藏。这样导致一个问题多次碰上就要多次去搜解决方法。现在，哥受够了，所以尽量不懒惰，能记的都记下来。</p>\r\n<p>&nbsp; 今天在新公司，要处理公司的相关服务器，同事时win下用xshell存储服务器信息，连的时候还发指的药去查账号和密码，我这么高大上的MacBook怎么能这么低端，所以就用终端来给他show下，分别用到ssh key和config两个功能，即可高大上。</p>\r\n<p>&nbsp; 先说key，客户端终端运行ssh-keygen&nbsp;-t&nbsp;rsa&nbsp;-P&nbsp;\' &nbsp;生成id_rsa.pub和id_rsa,这两个分别是公钥和私钥。然后把公钥里的内容复制到服务端的~/.ssh/authorized_keys文件里。就这一步，就可以免密码登录了。</p>\r\n<p>&nbsp; 然后因为有很多服务器要管理，总不能每次ssh <a href=\"mailto:xxx@xxx.xxx.xx.xx\">xxx@xxx.xxx.xx.xx</a>吧，所以下面就到了ssh的config，在~/.ssh/config里分别设置Host（别名）、 HostName（主机地址）、 User（用户名）、 Port（ssh端口，默认的话可以不用配置该参数）。</p>\r\n<p>&nbsp; 保存退出之后，即可ssh 别名 连到服务器了。第一次这么装逼，请让我多装一会。。哈哈哈（请自行脑补C罗进球后的表情）</p>\r\n<p>&nbsp;</p>','static/2015-03-17'),(23,'傻X零基础系列－－linux 时间问题','wicky','2015-03-20','<p class=\"p1\"><span class=\"s1\">新加入的公司实行每日服务器巡检，很不幸我所在的部门服务器超多，每天人肉上去查下参数感觉很傻很天真。所以一怒之下我就想了一个很挫的办法，写脚本。。想法是脚本在服务器上每天定时查询下cpu、内存、硬盘等信息，然后把这些数据打上服务器标签（其实就是表明时哪个服务器的数据），然后get请求到我的vps上，我的vps上起个web服务，接受这些信息，并入库。每天再定时把当天所有数据邮件发出，这样就不需要傻傻的人肉服务器了。撸了一天算是搞定了。（喂，一天已经很快了好不好，菜鸟进阶也是需要时间的。）</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&nbsp; 这其中逻辑很明确，但是中间碰上了比较恶心的问题，那就是linux的系统时间，别笑，你妹的。。网上找了各种方案之后终于发现一靠谱的，解决之。</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&nbsp; 记录下：（ubuntu系统）sudo tzconfig&nbsp;&nbsp; #如果命令不存在请使用:dpkg-reconfigure tzdata &nbsp;事实证明我就是用的后面那个命令。运行之后会进入类似mysql安装的时候的图形界面，让你选择时区，首选选asia，然后选择上海，回来在终端里date一下，咦，终于好了。干。。</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&nbsp; 别着急高兴，还要来一句sudo cp /usr/share/zoneinfo/Asia/Shanghai /etc/localtime &nbsp;否则服务器重启之后又傻眼了。</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&nbsp;&nbsp;hwclock -w 将系统时间也一并写入硬件时间。这里就告一段落了。</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&nbsp; 之后我又开开心心撸起了代码，但是后来测试又发现了一问题，mysql插入数据之后时间戳依然还是不对。愁死。都想摸脖子了。。终于找到了办法，网上看说不知道啥原因，时间会落后8小时，我默默的算了下，还真是。之后设置time_zone 就ok了。</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&nbsp; 哎，这种简单的问题都把我折腾成这样，真是惭愧，需要走的路还很长啊。。</span></p>','static/2015-03-20'),(26,'傻X零基础系列－－利用shadowscoks翻X','wicky','2015-03-26','<p>自从来了这个公司，一直苦于无法同步我的chrome标签，各种资源没法用。实在是蛋疼。之前自己搭了pptp，但是可能因为公司route不支持某协议，导致无法连接成功，一直停留在&ldquo;正在验证​用户名密码&rdquo;阶段。</p>\r\n<p>&nbsp; 付费的又蛮贵的，对我的需求来说。所以一直惦记着啥时候再折腾下，哪怕就翻那么一下下，让我把chrome登陆了，标签同步过来呀。</p>\r\n<p>&nbsp; 今天不经意间，经过骚光那里，看到他手机上有google paly，我就好奇的问你能连上google play ？ 后来这货告知了我shadowsocks的github地址，上去看了下，卧槽，这也太简单了吧。就简单几步。我立马ssh上我的vps，搭了起来，整个过程还算顺利，现在已经在轻轻松松的出墙来了。</p>\r\n<p>&nbsp; 因为我的vps是amazon的ec2，期间出现了一直无法连接到相应端口的情况，找了一段时间的原因。后来登陆了ec2的web控制台看了下，原来是group里默认把内网的端口限制了，故开了下input的相应端口，回去一测试，果然好了。</p>\r\n<p>&nbsp; 具体步骤就几步，简单记下吧(我是用的github里的python项目)</p>\r\n<p>&nbsp; &nbsp; &nbsp;1、pip install shadowsocks</p>\r\n<p>&nbsp; &nbsp; &nbsp;2、vim /etc/shadowsocks.json</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ----</p>\r\n<pre><code> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;{\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"server\":\"0.0.0.0\",\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"server_port\":8388,\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"local_address\": \"127.0.0.1\",\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"local_port\":8388,\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"password\":\"******\",\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"timeout\":300,\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"method\":\"RC4-MD5\",\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; \"fast_open\": false\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;}<br /> &nbsp; &nbsp;</code></pre>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>&nbsp; 就这两步，安装配置已经完成，接下来就是启动啦。</p>\r\n<p>&nbsp; &nbsp; &nbsp;3、ssserver -c /etc/shadowsocks.json -d start</p>\r\n<p>&nbsp; 这时候服务已经起来了，然后在你要出墙的设备上安装上相应客户端，然后连接可以了。</p>\r\n<p>&nbsp; shadowsocks支持多平台，各客户端下载地址：<a href=\"https://shadowsocks.com/client.html\">https://shadowsocks.com/client.html</a></p>\r\n<p>&nbsp; PS:我用的是OSX的客户端，客户端里有配置文件，里面可以添加当你不要全局代理而选用自动代理时要访问的网站域名，当然大部分它已经有了，比如google、twitter。</p>\r\n<p>&nbsp; 好了，今天就到这里，这么简单个事，写了这么一大篇，我绝逼特么的是个话痨。</p>','static/2015-03-26'),(28,'ssh key登陆失败','wicky','2015-06-16','<p>&nbsp; 配置ssh id_rsa.pub登陆的时候，明明都配置正确了，目标服务器却一直提示我失败，需要密码登陆。查了下，出现这个问题的原因主要有selinux原因、sshd配置文件未开启key验证、author文件权限不对。</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;首先确认~/.ssh/authorized_keys 权限是否为600，</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;其次看selinux是否关闭，如果开启，则setenforce 0暂时关闭，反之亦然，</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;然后，也是最最重要的，实际上我的这个情况就出现在这个问题上，</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;vim /etc/ssh/sshd_config 看下&nbsp;RSAAuthentication yes &nbsp;PubkeyAuthentication yes &nbsp;AuthorizedKeysFile .ssh/authorized_keys 这三项是否被注释了，如果是，则取消注释。</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;最后/etc/init.d/sshd restart 重启下ssh服务即可。</p>\r\n<p>&nbsp; 现在，退出服务器，再远程连接，应该就可以免密码登陆了。</p>','static/2015-06-16');
